import Link from "next/link";
import Logo from "../image/logo192.png";
function Navbar(){
    return (
        <header className="landing">
          <div className="navbar-header">
            <div className="nav-logo">
              <img src={Logo} alt="nav-logo" />
           </div>


           <div className="nav-tool">
             <Link className="navlink nav-hide" href="/">Home</Link>
             <Link className="navlink nav-hide" href="/blog">Blog</Link>
             <Link className="navlink nav-hide" href="/about">About Us</Link>
             <Link className="navlink nav-hide" href="/services">Services</Link>
             <Link className="navlink nav-hide" href="/contact">Contact</Link>
           </div>
          </div>
         
    <style jsx>{`
           .landing{
            /* height:105vh; */
        
            width:100%;
            display:flex;
            flex-direction:column;
            flex-wrap: wrap;
            background: #000000;;
            /* border-top:1000px red;
            border-right: 1000px solid white; 
            border-left:1000px solid white; */
        }
        
        .navbar-header{
            height:4rem;
            /* position:absolute; */
            display:flex;
            flex-direction:row;
            align-items: center;
            justify-content: space-between;  
            padding:0rem 3rem;  
        }
        .nav-logo img{
            height:3rem;
            
        }
        
        .nav-tool{
            display:flex;
            flex-direction:row;
            
        }
        .nav-icon{
            color:white;
        }
        .nav-tool .navlink{
            text-decoration: none;
            color:white;
            padding:0 1.5rem;
        }
        .nav-tool .navlink.active{
           color:blue;
           font-weight:bold;
        }
        
        .icon-bar{
            display:none;
        }
        
        @media (max-width:800px){
            .nav-tool{
                display:none;
            }
            .icon-bar{
                display:block;
                height:4rem;
                width:250px;
                float:right;
                background:red;
            }
            .navbar-header{
                padding:0 1rem;
            }
        }
    `}</style>
        </header>
    )
}

export default Navbar;
